import styled from 'styled-components'

const StyledHero = styled.div`
  background-image: url("/hero.jpeg");
  height: 60vh;
`

const Hero = () => (
  <StyledHero>
    <h1>Welcome to the Hawkins Public Library</h1>
    <input></input>
  </StyledHero>
)

export default Hero
